import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
          AAA
      </div>
    );
  }
}


class Entrada extends Component{
   render(){
      return ( 
          <div>Ola Mundo</div>
      );
   }
}

export default App;
